import "./App.css";
import Footer from "./components/Footer";
import Navbar from "./components/Navbar";
import Home from "./pages";
import { Router, Route, Switch } from "react-router-dom";
import React from "react";

function App() {
  return (
    <>
      <Navbar />

      <Router>
        <Switch>
          <Route path="/" component={Home} />
        </Switch>
      </Router>

      <Footer />
    </>
  );
}

export default App;
